import instance from './api';
import {testimonialsContentDataSuccess} from "./testimonialsAC";
const type="CLIENTS_CONTENT_DATA_SUCCESS";
export function clientsContentDataSuccess(clients) {
    return {
        type: type,
        payload: clients
    }
}

export const clientsContentData =  (url) => dispatch => {

    // Promise is resolved and value is inside of the response const.
      instance.get(url)
        .then(response => response.json())
        .then(clients => dispatch(clientsContentDataSuccess(clients)))
}
